import { useEffect } from 'react';
import './App.css';

function App() {
  console.log("Hello"); // This will log "Hello" to the console when the component renders

  useEffect(() => {
    const reqBody = {
      "username": "vivek",
      "password": "asdfasdf"
    };

    fetch("api/auth/login", {
      headers: {
        "Content-Type": "application/json"
      },
      method: "post",
      body: JSON.stringify(reqBody) // Sending the request body as JSON
    })
    .then((response) => Promise.all([response.json(), response.headers]))
    .then(([body, headers]) => {
      const jwt = headers.get("authorization"); // Getting the "authorization" header value
      console.log(jwt); // Logging the authorization header value
      console.log(body); // Logging the response body data
    });
  }, []); // The empty array means this effect runs only once when the component mounts

  return (
    <div className="App">
      <h1>Hello</h1>
    </div>
  );
}

export default App;
